import React from "react";
import { Link } from "react-router-dom";

class Header extends React.Component {
    handleNavigation = (path) => {
        window.location.href = path;
    };

    render() {
        return (
            <header>
                <div className="logo-container">
                    <img
                        src="https://www.skrill.com/fileadmin/Personal/promotions/skrill-ac-milan/ac-milan.PNG"
                        alt="AC Milan Logo"
                        className="logo-img"
                    />
                    <span className="logo-text">AC Milan</span>
                    <ul className="nav">
                        <li>
                            <Link to="/about">Про клуб</Link>
                        </li>
                        <li>
                            <Link to="/team">Основна команда</Link>
                        </li>
                        <li>
                            <Link to="/youth">Молодіжна команда</Link>
                        </li>
                    </ul>
                </div>
                <div className="presentation"></div>
            </header>
        );
    }
}

export default Header;
